import { orderService } from "../services/orderService"

// Action Creator
const _setOrder = (order) => ({ type: 'SET_OREDER', order })


// Action Dispatcher 
export function loadOrder() {
    return async (dispatch) => {
        const order = await orderService.getOrder()
        dispatch(_setOrder(order))
    }
}
